import React from 'react';
import TableItems from './TableItems';

const TableList = ({ guests, tables }) => {

    const renderedTables = guests.map(guest => {
        return <TableItems />
    });

    return (
        <div>
            <div className="tabSelector-wrapper">
                <div className="tabSelector">   
                        <TableItems />
                        <TableItems />
                        <TableItems />
                        <TableItems />
                        <TableItems />
                        <TableItems />
                </div>
            </div>
        </div>
    );
}

export default TableList;
